<?php

declare(strict_types = 1);

use Irice\Learning\Division3;
use PHPUnit\Framework\TestCase;
use PHPUnit\Framework\Attributes\Group;
use PHPUnit\Framework\Attributes\DataProvider;
use PHPUnit\Framework\Attributes\CoversNothing;

class Division3Test extends TestCase
{
    protected $_target;

    protected function setUp(): void
    {
        $this->_target = new Division3();
    }

    #[CoversNothing]
    #[DataProvider('summaryProvider')]
    #[Group('division3')]
    public function testSummary(string $input): void
    {
        $tmp = str_split($input, 1);
        $this->assertEquals(array_sum($tmp), $this->_target::summary($input));
    }

    public static function summaryProvider()
    {
        return [["23"], ["0081"], ["022"], ["31415926"]];
    }

    #[CoversNothing]
    #[DataProvider('solutionProvider')]
    #[Group('division3')]
    public function testSolution(string $input): void
    {
        $this->assertEquals(330486, $this->_target::solution($input));
    }

    public static function solutionProvider()
    {
        return [['']];
    }
}